import React, {Component} from 'react';
import './App.css';
import PdfParse from './PdfParse';

const initialState = {
   text: '',
}

class App extends Component {
   constructor() {
      super();
      this.state = initialState;
   }
  render() {
     return (
         <div className="App">
            <PdfParse/>
         </div>
      );
   }
}

export default App;
